import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import { hasPersonalRecords, formatOptionalValue } from '../../utils/profileUtils';

/**
 * ProfileView component for displaying user profile in read-only mode
 * @param {Object} profile - User profile data
 * @param {Function} onEdit - Callback when edit button is clicked
 * @param {Function} onDelete - Callback when delete button is clicked
 * @param {boolean} loading - Loading state
 */
const ProfileView = ({ profile, onEdit, onDelete, loading }) => {
  return (
    <Box>
      {/* Basic Information */}
      <Typography variant="h6">Name: {profile.name}</Typography>
      <Typography>Email: {profile.email}</Typography>
      <Typography>Age: {profile.age}</Typography>
      <Typography>Sex: {profile.sex}</Typography>
      <Typography>Weight: {profile.weight} kg</Typography>
      <Typography>Height: {profile.height} cm</Typography>

      {/* Current Fitness */}
      <Typography variant="h6" sx={{ mt: 2 }}>Current Fitness</Typography>
      <Typography>Fitness Level: {profile.current_fitness?.fitness_level}</Typography>
      <Typography>Training Frequency: {profile.current_fitness?.training_frequency} days/week</Typography>

      {/* Optional body fat percentage */}
      {profile.current_fitness?.body_fat_percentage > 0 && (
        <Typography>Body Fat: {profile.current_fitness.body_fat_percentage}%</Typography>
      )}

      {/* Personal Records */}
      {hasPersonalRecords(profile.current_fitness?.personal_records) && (
        <>
          <Typography variant="subtitle2" sx={{ mt: 1 }}>Personal Records:</Typography>
          {profile.current_fitness.personal_records.deadlift > 0 && (
            <Typography>Deadlift: {profile.current_fitness.personal_records.deadlift} kg</Typography>
          )}
          {profile.current_fitness.personal_records.squat > 0 && (
            <Typography>Squat: {profile.current_fitness.personal_records.squat} kg</Typography>
          )}
          {profile.current_fitness.personal_records.bench > 0 && (
            <Typography>Bench Press: {profile.current_fitness.personal_records.bench} kg</Typography>
          )}
        </>
      )}

      {/* Goals */}
      <Typography variant="h6" sx={{ mt: 2 }}>Goals</Typography>
      <Typography>Goal Types: {profile.goals?.goal_types?.join(', ') || 'None specified'}</Typography>

      {/* Optional target values */}
      {profile.goals?.target_weight > 0 && (
        <Typography>Target Weight: {profile.goals.target_weight} kg</Typography>
      )}
      {profile.goals?.target_body_fat > 0 && (
        <Typography>Target Body Fat: {profile.goals.target_body_fat}%</Typography>
      )}

      {/* Target Personal Records */}
      {hasPersonalRecords(profile.goals?.target_personal_records) && (
        <>
          <Typography variant="subtitle2" sx={{ mt: 1 }}>Target Personal Records:</Typography>
          {profile.goals.target_personal_records.deadlift > 0 && (
            <Typography>Target Deadlift: {profile.goals.target_personal_records.deadlift} kg</Typography>
          )}
          {profile.goals.target_personal_records.squat > 0 && (
            <Typography>Target Squat: {profile.goals.target_personal_records.squat} kg</Typography>
          )}
          {profile.goals.target_personal_records.bench > 0 && (
            <Typography>Target Bench Press: {profile.goals.target_personal_records.bench} kg</Typography>
          )}
        </>
      )}

      {/* Action Buttons */}
      <Box sx={{ mt: 3, display: 'flex', gap: 2 }}>
        <Button variant="contained" onClick={onEdit} disabled={loading}>
          Edit Profile
        </Button>
        <Button variant="outlined" color="error" onClick={onDelete} disabled={loading}>
          Delete Account
        </Button>
      </Box>
    </Box>
  );
};

export default ProfileView;
